import "./css/Footer.css"


function Footer() {
  return (
    <footer>

      <ul className="footer_list">
        <li> <a href="/">privavy policy</a></li>
        <li> <a href="/">contact</a></li>
        <li> <a href="/">imperial war museum</a></li>
      </ul>


      <div>©melchiott‘s bakery</div>
      <div>This image is copyright protected under UK copyright Law. </div>

    </footer>
  );
}

export default Footer;
